import LogoEJ from '../../assets/images/logo.svg';

const Home = () => {
    return (
        <div className="container home-page">
            <div className="text-zone">
                <h1>Hello, <br /> I'm</h1>
                <img src={LogoEJ} alt="me" />
            </div>
        </div>
    );
}

export default Home
